import React, {useState, useEffect, useRef} from "react";
import { useHistory } from "react-router-dom";
// import ColoredInImage from "./images/coloredInImage";
import Stitch from "../images/stitch.js";
import Ariel from "../images/ariel.js";
import Minnie from "../images/minnie";
import Cat from "../images/cheshireCat.js";
import R2D2 from "../images/r2d2.js";
// import YODA from "../images/yoda.js";

export default function ColoredInImage(props) {
    const[image, setImage] = useState({});

    useEffect(() => {
        setImage(props)
        // console.log(image)
    }, [props])


    return(
        <div className="col-4 mx-auto my-auto">">
            {image.component === "stitch" ? <Stitch id="svg-image" size={image.size} onFill={image.onFill} fillColors={image.fillColors} /> :
            image.component === "ariel" ? <Ariel id="svg-image" onFill={image.onFill} fillColors={image.fillColors} /> :
            image.component === "r2d2" ? <R2D2 id="svg-image" onFill={image.onFill} fillColors={image.fillColors} /> :
            image.component === "cat" ? <Cat id="svg-image" onFill={image.onFill} fillColors={image.fillColors} /> :
            // image.component === "yoda" ? <YODA id="svg-image" onFill={image.onFill} fillColors={image.fillColors} /> :
            image.component === "minnie" ? <Minnie id="svg-image" onFill={image.onFill} fillColors={image.fillColors} /> :
            <>Not Available</> }       
        </div>
    )
}
